import React from 'react'
import BotCard from "./Card"

function Botcollection({ botlist, action, removeCard }) {
  const displayCards =  botlist ? botlist.map(bot => {
    return <Card bot={bot} action={action} removeCard={removeCard} />
  }):null;

  return (
    <div className="ui four column grid">
      <div className="row">
        {displayCards}
        Your recruitment is complete .Thank YOU !
      </div>
    </div>
  )
}
export default Botcollection;
